import React from 'react'

const BirthdayToday = ({ people }) => {
    const divStyleCard = {
        width: "18rem",
        height:"16rem",
        color:"#121212",
    }
    return (
        <>
            {people.map((person) => {
                const { id,path, name, birthday } = person;
                return (
                        <div className="card m-4" style={divStyleCard}>
                            <img className="card-img-top" src={path} alt={name} />
                            <div className="card-body">
                                <h5 className="card-title">{name}</h5>
                                <p className="card-text">{birthday}</p>
                                <button className="btn btn-primary">Remove</button>
                            </div>
                        </div>
                )
            })}
        </>
    )
}

export default BirthdayToday
